import { memo, useState, useEffect } from 'react'
import { useLocation } from 'react-router-dom'
import './HistoryBookingCustomer.scss'

function HistoryBookingCustomer({ languageSelected, listBooking }) {
    const [option, setOption] = useState(0)

    return (
        <div className='container'>
            <nav className='d-flex br-all'>
                <div onClick={() => setOption(0)} className={`w-33 text-center tab-history-booking ${option === 0 && 'tab-history-booking-selected'}`}>asd</div>
                <div onClick={() => setOption(1)} className={`w-33 text-center tab-history-booking ${option === 1 && 'tab-history-booking-selected'}`}>asd</div>
                <div onClick={() => setOption(2)} className={`w-33 text-center tab-history-booking ${option === 2 && 'tab-history-booking-selected'}`}>asd</div>
            </nav>
            <div className='mt-20'>
                {listBooking.map((item) => (
                    <div className='mb-20 item-list-history-booking d-flex'>
                        <div>
                            <div>{item.tourName}</div>
                        </div>
                        <div>Xem chi tiet tour</div>
                    </div>
                ))}

            </div>
        </div>
    )
}

export default memo(HistoryBookingCustomer)
